import React from 'react';
import '../App.css';
import WorkProcessCard from './WorkProcessCard';
import './WorkProcess.css';
import { Grid } from '@material-ui/core';


function WorkProcess(){
    return (
        <div className="works_cards">
            <h1>Work Process</h1>
            <p className="work_title">To make life of our clients easier, we have developed a comprehensive workflow.</p>
            <Grid className="cards__container">
                <Grid className="cards__wrapper">
                    <ul className="cards__items">
                        <WorkProcessCard heading="Get Ideas"text="Every Project start with great idea and good motivation"/>
                        <WorkProcessCard heading="Discuss" text="Your inputs are most valuable asset for success."/>
                        <WorkProcessCard  heading="Make Plan" text="An thoughtful execution plan ensures timely delivery."/>
                        <WorkProcessCard  heading="Production" text="Lights Camera Action! All the magic happens here."/>
                        <WorkProcessCard heading="Post Production" text="Where everything is creatively stitched together."/>
                        <WorkProcessCard heading="Approval" text="Your approval really means a lot for our entire team."/>
                    </ul>
                </Grid>
            </Grid>
        </div>
    )
}

export default WorkProcess
